
(function(){
  function q(sel, root){ return (root||document).querySelector(sel); }
  function qa(sel, root){ return Array.prototype.slice.call((root||document).querySelectorAll(sel)); }

  function fmtEUR(x){
    return new Intl.NumberFormat('de-DE', { style:'currency', currency:'EUR' }).format(x);
  }
  function fmtNum(x){
    return new Intl.NumberFormat('de-DE', { maximumFractionDigits: 1 }).format(x);
  }


  const RG_BRAND = {
    primary: [22, 198, 229],   // #16C6E5
    dark: [15, 37, 55],        // #0F2537
    success: [47, 191, 113],   // #2FBF71
    lightBg: [245, 251, 253],  // #F5FBFD
    grey: [107, 114, 128]
  };
  const RG_LOGO_DATA = 'data:image/png;base64,';
  const RG_QR_DATA = 'data:image/png;base64,';


  function computeRating(calc){
    // Robo-Guru Einordnung (keine Garantie)
    if (!calc || !calc.net || calc.net <= 0) {
      return { level: 'bad', label: 'Grenzfall', text: 'Netto-Ersparnis nicht positiv' };
    }
    if (calc.mode === 'purchase') {
      const pb = calc.paybackMonths;
      if (pb !== null && pb <= 18) return { level: 'good', label: 'Sehr wirtschaftlich', text: `Break-even nach ca. ${fmtNum(pb)} Monaten` };
      if (pb !== null && pb <= 36) return { level: 'ok', label: 'Wirtschaftlich', text: `Break-even nach ca. ${fmtNum(pb)} Monaten` };
      return { level: 'bad', label: 'Grenzfall', text: `Break-even nach ca. ${fmtNum(pb)} Monaten` };
    }
    // Leasing: vereinfachter ROI als Einordnung
    const r = calc.roi;
    if (r !== null && r >= 40) return { level: 'good', label: 'Sehr wirtschaftlich', text: `Positiver Cashflow  ROI ca. ${fmtNum(r)} %` };
    if (r !== null && r >= 20) return { level: 'ok', label: 'Wirtschaftlich', text: `Positiver Cashflow  ROI ca. ${fmtNum(r)} %` };
    return { level: 'bad', label: 'Grenzfall', text: `Positiver Cashflow  ROI ca. ${fmtNum(r)} %` };
  }


  function drawRoiChart(doc, x, y, w, h, monthlyNet, invest, monthsToShow) {
    doc.setLineWidth(0.2);
    doc.rect(x, y, w, h);

    const pad = 7;
    const cx = x + pad;
    const cw = w - pad * 2;
    const ch = h - pad * 2;

    if (!monthlyNet || monthlyNet <= 0 || invest < 0) {
      doc.setFontSize(10);
      doc.text('Keine positive Netto-Ersparnis  Break-even nicht erreichbar.', cx, y + h/2);
      return { breakEvenMonth: null, monthsShown: monthsToShow || 36 };
    }

    const breakEvenMonth = Math.max(1, Math.ceil(invest / monthlyNet));
    const mShow = Math.min(Math.max(monthsToShow || 36, breakEvenMonth + 12), 60);

    const maxCum = monthlyNet * mShow;
    const maxYVal = Math.max(maxCum, invest * 1.2);

    const yFor = (val) => (y + h - pad) - (ch * (val / maxYVal));
    const xForM = (m) => cx + (cw * (m - 1)) / (mShow - 1);

    // x-axis
    doc.setLineWidth(0.2);
    doc.line(cx, y + h - pad, x + w - pad, y + h - pad);

    // Investitionslinie (gestrichelt)
    const yInvest = yFor(invest);
    doc.setLineWidth(0.4);
    doc.setLineDashPattern([2, 2], 0);
    doc.line(cx, yInvest, x + w - pad, yInvest);
    doc.setLineDashPattern([], 0);
    doc.setFontSize(9);
    doc.text('Investition', x + w - pad - 22, yInvest - 2);

    // Kumulierte Ersparnis (Linie)
    const points = [];
    for (let m = 1; m <= mShow; m++) {
      const cum = monthlyNet * m;
      points.push([xForM(m), yFor(cum), cum]);
    }

    doc.setLineWidth(0.7);
    for (let i = 1; i < points.length; i++) {
      doc.line(points[i-1][0], points[i-1][1], points[i][0], points[i][1]);
    }

    // Break-even Markierung (grn)
    const be = Math.min(breakEvenMonth, mShow);
    const beX = xForM(be);
    const beY = yFor(monthlyNet * be);

    doc.setDrawColor(0, 140, 0);
    doc.setLineWidth(0.6);
    doc.line(beX, y + pad, beX, y + h - pad);

    doc.setFillColor(0, 140, 0);
    doc.circle(beX, beY, 1.5, 'F');

    doc.setTextColor(0, 120, 0);
    doc.setFontSize(10);
    doc.text(`Break-even ab Monat ${breakEvenMonth}`, Math.min(beX + 2, x + w - pad - 55), y + pad + 10);

    // Reset
    doc.setDrawColor(0,0,0);
    doc.setTextColor(0,0,0);

    // Labels
    doc.setFontSize(9);
    doc.text('Kumulierte Netto-Ersparnis (Beispielrechnung)', cx, y + pad - 1);
    doc.text(`Monat 1`, cx, y + h - 2);
    doc.text(`Monat ${mShow}`, x + w - pad - 22, y + h - 2);

    return { breakEvenMonth, monthsShown: mShow };
  }

  function addHeaderFooter(doc){
    const pageCount = doc.getNumberOfPages();
    const dateStr = new Date().toLocaleDateString('de-DE');

    for (let i = 1; i <= pageCount; i++) {
      doc.setPage(i);

      // Header
      // Small logo in top-right corner (print friendly)
      try { doc.addImage(RG_LOGO_DATA, 'PNG', 182, 5, 14, 14); } catch(e) {}
      doc.setFontSize(10);
      doc.setTextColor(...RG_BRAND.dark);
      doc.text('Robo-Guru | ROI-Berechnung Reinigungsrobotik', 14, 10);
      doc.setFontSize(9);
      doc.setTextColor(...RG_BRAND.grey);
      doc.text(`Datum: ${dateStr}`, 145, 10);
      doc.setTextColor(...RG_BRAND.dark);
// Footer
      doc.setFontSize(8);
      doc.setTextColor(...RG_BRAND.grey);
      const disclaimer =
        'Hinweis: Vereinfachte Modellrechnung auf Basis Ihrer Angaben. Abweichungen durch Einsatzzeiten, Lohnkosten, Wartung, Energiepreise oder Frderungen mglich.';
      doc.text(disclaimer, 14, 287, { maxWidth: 160 });

      doc.setFontSize(9);
      doc.setTextColor(...RG_BRAND.grey);
      doc.text(`Seite ${i} / ${pageCount}`, 185, 292);
    }
  }

  function generatePdf(calc){
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF({ unit: 'mm', format: 'a4' });

    const monthlyNet = calc.net / 12;
    const beMonth = Math.max(1, Math.ceil(calc.invest / monthlyNet));
    const beText = `ab Monat ${beMonth} ist die Investition rechnerisch wieder drin.`;
    // Report header (page 1)
    // (Small logo is already placed in the page header via addHeaderFooter)
    doc.setTextColor(...RG_BRAND.dark);
    doc.setFontSize(18);
    doc.text('ROI-Berechnung Reinigungsrobotik', 14, 26);

    doc.setFontSize(10);
    doc.setTextColor(...RG_BRAND.grey);
    doc.text('Unabhngige Beispielrechnung zur Wirtschaftlichkeit', 14, 32);

    // subtle divider
    doc.setDrawColor(220, 228, 232);
    doc.setLineWidth(0.3);
    doc.line(14, 38, 196, 38);
    doc.setDrawColor(0,0,0);

    doc.setTextColor(...RG_BRAND.dark);
doc.setFontSize(12);
    doc.text('Zusammenfassung', 14, 46);

    doc.autoTable({
      startY: 50,
      theme: 'grid',
      head: [['Kennzahl', 'Wert']],
      body: [
        ['Investition gesamt', fmtEUR(calc.invest)],
        ['Geschtzte Netto-Ersparnis/Jahr', fmtEUR(calc.net)],
        ['Geschtzte Netto-Ersparnis/Monat', fmtEUR(monthlyNet)],
        ['ROI (vereinfachte Jahresbetrachtung)', `${fmtNum(calc.roi)} %`],
        ['Amortisation (Monate)', `${fmtNum(calc.paybackMonths)} Monate`],
        ['Break-even', beText],
        ['Einordnung', (calc.rating ? (calc.rating.label + '  ' + calc.rating.text) : '')],
      ],
      styles: { fontSize: 10 },
      headStyles: { fillColor: RG_BRAND.dark },
    });

    const chartY = doc.lastAutoTable.finalY + 10;
    doc.setFontSize(12);
    doc.text('Diagramm', 14, chartY);
    doc.setFontSize(10);
    doc.text('Entwicklung der kumulierten Netto-Ersparnis (Beispielrechnung)', 14, chartY + 6);

    drawRoiChart(doc, 14, chartY + 10, 182, 60, monthlyNet, calc.invest, 36);

    doc.addPage();

    const inputsY = 24;
    doc.setFontSize(12);
    doc.text('Berechnungsgrundlage', 14, inputsY);

    doc.autoTable({
      startY: inputsY + 4,
      theme: 'grid',
      head: [['Parameter', 'Wert']],
      body: [
        ['Modell', (calc.mode==='lease' ? 'Leasing' : 'Kauf')],
        ['Anzahl Roboter', String(calc.qty)],
        ...(calc.mode==='purchase'
          ? [['Kaufpreis pro Roboter', fmtEUR(calc.price)]]
          : [
              ['Leasingrate pro Roboter/Monat', fmtEUR(calc.leaseRateMonthly)],
              ['Laufzeit (Monate)', String(calc.leaseTermMonths)],
            ]),
        ['Eingesparte Stunden/Tag (pro Roboter)', String(calc.hoursPerDay)],
        ['Lohnkosten pro Stunde', fmtEUR(calc.hourlyRate)],
        ['Arbeitstage pro Jahr', String(calc.daysPerYear)],
        ['Servicekosten pro Roboter/Monat', fmtEUR(calc.serviceMonthly)],
        ['Stromkosten pro Roboter/Jahr', fmtEUR(calc.powerPerYear)],
        ['Flche pro Tag (optional)', (calc.areaSqmPerDay > 0 ? (new Intl.NumberFormat('de-DE').format(calc.areaSqmPerDay) + ' m') : '')],
      ],
      styles: { fontSize: 10 },
      headStyles: { fillColor: RG_BRAND.dark },
    });

// Annahmen
    const afterY = doc.lastAutoTable.finalY + 10;
    doc.setFontSize(12);
    doc.text('Annahmen der Berechnung', 14, afterY);
    doc.setFontSize(9);
    doc.setTextColor(...RG_BRAND.grey);
    const assumptions = [
      'Konstanter Betrieb ber das Jahr (Arbeitstage laut Eingabe).',
      'Personalkosten basieren auf dem eingegebenen Stundensatz.',
      'Service- und Stromkosten basieren auf Ihren Angaben.',
      'Keine Frderungen, Steuern oder Restwerte bercksichtigt.',
    ];
    let yy = afterY + 6;
    assumptions.forEach(a => { doc.text(' ' + a, 14, yy, { maxWidth: 182 }); yy += 5; });
    doc.setTextColor(...RG_BRAND.dark);
    // QR-Code (Seite 2)  fr Ausdruck & erneute Prfung
    // Place near bottom-right; keep page 1 clean.
    try {
      const qrSize = 28;
      const qrX = 196 - qrSize; // right margin align
      const qrY = 250;
      doc.setDrawColor(220, 228, 232);
      doc.setLineWidth(0.3);
      doc.line(14, 244, 196, 244);
      doc.setDrawColor(0,0,0);

      doc.setFontSize(10);
      doc.setTextColor(...RG_BRAND.dark);
      doc.text('Berechnung online erneut durchfhren', 14, 256);
      doc.setFontSize(9);
      doc.setTextColor(...RG_BRAND.grey);
      doc.text('robo-guru.de/roi-rechner', 14, 261);

      doc.addImage(RG_QR_DATA, 'PNG', qrX, qrY, qrSize, qrSize);
      doc.setTextColor(...RG_BRAND.dark);
    } catch(e) {}


    addHeaderFooter(doc);
    return doc;
  }

  function toCalc(root){
    const getNum = (key) => {
      const el = q(`[data-rg="${key}"]`, root);
      if (!el) return 0;
      return Number(el.value || 0);
    };
    const getStr = (key) => {
      const el = q(`[data-rg="${key}"]`, root);
      if (!el) return '';
      return String(el.value || '');
    };

    const mode = (getStr('mode') || 'purchase').toLowerCase(); // purchase | lease

    const price = getNum('price');
    const leaseRateMonthly = getNum('leaseRateMonthly');
    const leaseTermMonths = Math.max(0, parseInt(getStr('leaseTermMonths') || '0', 10) || 0);

    const qty = Math.max(1, getNum('qty'));

    const hoursPerDay = getNum('hoursPerDay');
    const hourlyRate = getNum('hourlyRate');
    const daysPerYear = getNum('daysPerYear');

    const areaSqmPerDay = getNum('areaSqmPerDay');

    const servicePreset = getStr('servicePreset');
    const serviceMonthly = getNum('serviceMonthly');
    const powerPerYear = getNum('powerPerYear');

    // Kostenblcke
    const investUpfront = (mode === 'purchase') ? (price * qty) : 0;
    const contractVolume = (mode === 'purchase')
      ? investUpfront
      : (leaseRateMonthly * leaseTermMonths * qty);

    const laborSavingsYear = hoursPerDay * hourlyRate * daysPerYear * qty;

    const serviceYear = serviceMonthly * 12 * qty;
    const powerYear = powerPerYear * qty;
    const opsYear = serviceYear + powerYear;

    const leaseYear = (mode === 'lease') ? (leaseRateMonthly * 12 * qty) : 0;

    const totalCostYear = opsYear + leaseYear;
    const netYear = laborSavingsYear - totalCostYear;
    const monthlyNet = netYear / 12;

    // ROI (vereinfachte Jahresbetrachtung)
    let roi = null;
    if (netYear > 0) {
      if (mode === 'purchase' && investUpfront > 0) {
        roi = (netYear / investUpfront) * 100;
      } else if (mode === 'lease' && totalCostYear > 0) {
        roi = (netYear / totalCostYear) * 100;
      }
    }

    // Amortisation / Break-even
    let paybackMonths = null;
    let breakEvenMonth = null;
    let beText = '';

    if (netYear > 0) {
      if (mode === 'purchase' && investUpfront > 0) {
        paybackMonths = (investUpfront / netYear) * 12;
        breakEvenMonth = Math.max(1, Math.ceil(investUpfront / monthlyNet));
        beText = `ab Monat ${breakEvenMonth} ist die Investition rechnerisch wieder drin.`;
      } else if (mode === 'lease') {
        // Bei Leasing ist das i.d.R. ein Cashflow-Thema (monatlich)
        paybackMonths = 1;
        breakEvenMonth = 1;
        beText = 'ab Monat 1 ist die monatliche Belastung rechnerisch gedeckt (positiver Cashflow).';
      }
    }

    // m Plausibilitt (optional)
    const sqmPerHour = (hoursPerDay > 0 && areaSqmPerDay > 0) ? (areaSqmPerDay / hoursPerDay) : null;

    // Export-Logik
    const canExport =
      (netYear > 0) &&
      (
        (mode === 'purchase' && investUpfront > 0) ||
        (mode === 'lease' && leaseRateMonthly > 0 && leaseTermMonths > 0)
      );

        const rating = computeRating({ mode, net: netYear, paybackMonths, roi });

    return {
      mode,
      price,
      leaseRateMonthly,
      leaseTermMonths,
      qty,
      hoursPerDay,
      hourlyRate,
      daysPerYear,
      areaSqmPerDay,
      servicePreset,
      serviceMonthly,
      powerPerYear,
      investUpfront,
      invest: contractVolume,
      grossSavings: laborSavingsYear,
      opsCosts: opsYear,
      leaseYear,
      totalCostYear,
      net: netYear,
      monthlyNet,
      roi,
      paybackMonths,
      breakEvenMonth,
      beText,
      rating,
      sqmPerHour,
      canExport
    };
  }
  function render(root, calc){
    const out = (name) => q(`[data-rg-out="${name}"]`, root);

    
    // Rating (Ampel)
    const ratingWrap = out('ratingWrap');
    if (ratingWrap && calc.rating){
      ratingWrap.setAttribute('data-level', calc.rating.level);
      const lab = q('[data-rg-out="ratingLabel"]', ratingWrap);
      const txt = q('[data-rg-out="ratingText"]', ratingWrap);
      if (lab) lab.textContent = calc.rating.label;
      if (txt) txt.textContent = calc.rating.text;
    }

out('invest').textContent = fmtEUR(calc.invest);
    out('gross').textContent  = fmtEUR(calc.grossSavings);
    out('ops').textContent    = fmtEUR(calc.opsCosts);
    out('net').textContent    = fmtEUR(calc.net);
    if (out('monthly')) out('monthly').textContent = fmtEUR(calc.monthlyNet);

    if (out('finModel')) out('finModel').textContent = (calc.mode === 'lease') ? 'Leasing' : 'Kauf';
    if (out('leaseYear')) out('leaseYear').textContent = (calc.mode === 'lease') ? fmtEUR(calc.leaseYear) : '';
    if (out('area')) out('area').textContent = (calc.areaSqmPerDay > 0) ? (new Intl.NumberFormat('de-DE').format(calc.areaSqmPerDay) + ' m') : '';
    if (out('sqmPerHour')) out('sqmPerHour').textContent = (calc.sqmPerHour && isFinite(calc.sqmPerHour)) ? (new Intl.NumberFormat('de-DE', { maximumFractionDigits: 0 }).format(calc.sqmPerHour) + ' m/h') : '';

    // Hints
    if (out('investHint')) {
      out('investHint').textContent = (calc.mode === 'lease')
        ? 'Vertragsvolumen = Rate  Laufzeit  Anzahl'
        : 'Investition gesamt = Kaufpreis  Anzahl';
    }
    if (out('sqmHint')) {
      if (calc.sqmPerHour && calc.sqmPerHour > 2500) {
        out('sqmHint').textContent = 'Hinweis: Aus Flche und Stunden ergibt sich eine sehr hohe Leistung (Plausibilitt prfen).';
      } else if (calc.sqmPerHour && calc.sqmPerHour < 200) {
        out('sqmHint').textContent = 'Hinweis: Aus Flche und Stunden ergibt sich eine eher niedrige Leistung (Plausibilitt prfen).';
      } else {
        out('sqmHint').textContent = 'Tipp: Wird zur Einordnung genutzt (keine harte Rechenbasis).';
      }
    }

    const warnEl = out('warn');
    const hintEl = out('hint');

    const canExport = !!calc.canExport;

    const pdfBtn = q('[data-rg-btn="pdf"]', root);
    const printBtn = q('[data-rg-btn="print"]', root);
    const mailBtn = q('[data-rg-btn="mail"]', root);

    pdfBtn.disabled = !canExport;
    printBtn.disabled = !canExport;
    mailBtn.disabled = !canExport;

    if (!canExport){
      out('roi').textContent = '';
      out('payback').textContent = '';
      if (out('monthly')) out('monthly').textContent = '';
      out('beText').textContent = '';
      warnEl.style.display = 'block';
      hintEl.textContent = 'Export ist aktiv, sobald eine positive Netto-Ersparnis berechnet wurde.';
      return { canExport: false };
    }

    warnEl.style.display = 'none';
    out('roi').textContent = fmtNum(calc.roi) + ' %';
    out('payback').textContent = (calc.mode === 'lease') ? 'ab Monat 1' : fmtNum(calc.paybackMonths);
    out('beText').textContent = calc.beText;
    hintEl.textContent = 'Export bereit. Break-even wird im Diagramm markiert.';
    return { canExport: true };
  }

  function bind(root){
    let lastCalc = toCalc(root);
    render(root, lastCalc);

    // Mode toggle (Kauf/Leasing)
    const modeSel = q('[data-rg="mode"]', root);
    const applyModeUi = () => {
      const mode = (modeSel && modeSel.value) ? modeSel.value : 'purchase';
      qa('[data-rg-mode]', root).forEach(el => {
        const m = el.getAttribute('data-rg-mode');
        if (m === mode) el.classList.remove('rg-hide'); else el.classList.add('rg-hide');
      });
    };
    if (modeSel) {
      modeSel.addEventListener('change', () => { applyModeUi(); lastCalc = toCalc(root); render(root, lastCalc); });
      applyModeUi();
    }

    // Service preset -> monthly value
    const presetSel = q('[data-rg="servicePreset"]', root);
    const svcInp = q('[data-rg="serviceMonthly"]', root);
    const applyPreset = () => {
      if (!presetSel || !svcInp) return;
      const v = String(presetSel.value || '');
      if (v === '-1') return; // custom
      const num = Number(v || 0);
      if (!isNaN(num)) svcInp.value = String(num);
    };
    if (presetSel) {
      presetSel.addEventListener('change', () => { applyPreset(); lastCalc = toCalc(root); render(root, lastCalc); });
      applyPreset();
    }

    qa('.rg-in', root).forEach(inp => {
      const recalc = () => {
        lastCalc = toCalc(root);
        render(root, lastCalc);
      };
      inp.addEventListener('input', recalc);
      inp.addEventListener('change', recalc);
    });

    q('[data-rg-btn="print"]', root).addEventListener('click', () => {
      lastCalc = toCalc(root);
      if (!lastCalc.canExport) return;
      const doc = generatePdf(lastCalc);
      const blob = doc.output('blob');
      const blobUrl = URL.createObjectURL(blob);
      const printWindow = window.open(blobUrl, '_blank');
      if (printWindow) {
        printWindow.addEventListener('load', () => {
          printWindow.focus();
          printWindow.print();
        });
      } else {
        // Fallback: Download if popup blocked
        doc.save(`ROI-Berechnung-Robo-Guru-${new Date().toISOString().slice(0,10)}.pdf`);
        alert('Popup blockiert. PDF wurde heruntergeladen - bitte manuell drucken.');
      }
    });

    q('[data-rg-btn="pdf"]', root).addEventListener('click', () => {
      lastCalc = toCalc(root);
      if (!lastCalc.canExport) return;
      const doc = generatePdf(lastCalc);
      doc.save(`ROI-Berechnung-Robo-Guru-${new Date().toISOString().slice(0,10)}.pdf`);
    });

    q('[data-rg-btn="mail"]', root).addEventListener('click', async () => {
      lastCalc = toCalc(root);
      if (!lastCalc.canExport) return;

      const email = (q('[data-rg="email"]', root).value || '').trim();
      if (!email || !email.includes('@')) {
        alert('Bitte eine gltige E-Mail-Adresse eingeben.');
        return;
      }

      const doc = generatePdf(lastCalc);
      const pdfBase64 = doc.output('datauristring'); // data:application/pdf;base64,...

      const ajaxUrl = (window.rgRoi && window.rgRoi.ajaxUrl) ? window.rgRoi.ajaxUrl : '/wp-admin/admin-ajax.php';
      const nonce = (window.rgRoi && window.rgRoi.nonce) ? window.rgRoi.nonce : '';

      const btn = q('[data-rg-btn="mail"]', root);
      const oldText = btn.textContent;
      btn.textContent = 'Sende...';
      btn.disabled = true;

      try {
        // WordPress AJAX requires action as URL parameter when sending JSON body
        const url = new URL(ajaxUrl, window.location.origin);
        url.searchParams.set('action', 'rg_send_roi_report');

        const res = await fetch(url.toString(), {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({
            nonce,
            email,
            calc: lastCalc,
            pdfBase64
          })
        });
        const json = await res.json();
        const msg = (json && json.data && json.data.message) ? json.data.message :
                    (json && json.message) ? json.message :
                    'Fertig.';
        alert(msg);
      } catch (e) {
        alert('Fehler beim Versand. Bitte spter erneut versuchen.');
      } finally {
        btn.textContent = oldText;
        btn.disabled = false;
      }
    });
  }

  document.addEventListener('DOMContentLoaded', () => {
    qa('[data-rg-roi]').forEach(bind);
  });
})();
